DROP TABLE IF EXISTS `pc_mdc_attachment`;
CREATE TABLE `pc_mdc_attachment` (
  `id` varchar(32) CHARACTER SET utf8 NOT NULL COMMENT '主键',
  `version` bigint(20) DEFAULT NULL COMMENT '版本号',
  `attachment_sn` varchar(20) CHARACTER SET utf8 NOT NULL,
  `attachment_no` varchar(20) CHARACTER SET utf8 NOT NULL COMMENT '附件流水号',
  `center_name` varchar(20) CHARACTER SET utf8 DEFAULT '' COMMENT '中心名称(英文简写)',
  `bucket_name` varchar(20) CHARACTER SET utf8 DEFAULT '' COMMENT '文件服务器根目录',
  `ref_no` varchar(20) CHARACTER SET utf8 DEFAULT NULL COMMENT '上传附件的相关业务流水号',
  `name` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '附件名称',
  `path` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '附件存储相对路径',
  `type` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '附件类型',
  `format` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '附件格式',
  `description` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '备注',
  `creator` varchar(50) CHARACTER SET utf8 DEFAULT NULL COMMENT '创建人',
  `creator_id` varchar(32) CHARACTER SET utf8 DEFAULT NULL COMMENT '创建人id',
  `created_time` datetime DEFAULT NULL COMMENT '创建日期',
  `last_operator` varchar(50) CHARACTER SET utf8 DEFAULT NULL COMMENT '最后操作人',
  `last_operator_id` varchar(32) CHARACTER SET utf8 DEFAULT NULL COMMENT '最后操作人id',
  `update_time` datetime DEFAULT NULL COMMENT '更新日期',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`) USING BTREE,
  UNIQUE KEY `serial_no` (`attachment_no`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='业务附件表';

