DROP TABLE IF EXISTS `pc_mdc_dict`;
CREATE TABLE `pc_mdc_dict` (
  `id` bigint(20) NOT NULL,
  `version` int(11) DEFAULT '0' COMMENT '版本号',
  `type` int(11) DEFAULT '0' COMMENT '字典类型 -0 目录 - 1 文件',
  `dict_key` varchar(32) CHARACTER SET utf8 DEFAULT '' COMMENT '枚举编码',
  `extend_key` varchar(32) CHARACTER SET utf8 DEFAULT '' COMMENT '枚举扩展字段',
  `dict_value` varchar(32) CHARACTER SET utf8 DEFAULT '' COMMENT '枚举值',
  `dict_code` varchar(32) CHARACTER SET utf8 DEFAULT '' COMMENT '字典编码',
  `dict_name` varchar(50) CHARACTER SET utf8 DEFAULT '' COMMENT '字典名称',
  `pid` bigint(20) DEFAULT NULL COMMENT '父ID',
  `number` int(11) DEFAULT '0' COMMENT '序号',
  `status` int(11) DEFAULT '10' COMMENT '状态 -10 可用 - 20 禁用',
  `remark` varchar(100) CHARACTER SET utf8 DEFAULT '' COMMENT '备注',
  `creator` varchar(20) CHARACTER SET utf8 DEFAULT NULL COMMENT '创建人',
  `creator_id` varchar(32) CHARACTER SET utf8 DEFAULT NULL COMMENT '创建人ID',
  `created_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `last_operator` varchar(20) CHARACTER SET utf8 DEFAULT NULL COMMENT '最近操作人',
  `last_operator_id` varchar(32) CHARACTER SET utf8 DEFAULT NULL COMMENT '最后操作人ID',
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`),
  UNIQUE KEY `dist_key` (`dict_key`,`dict_value`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='数据字典表';

